INSERT INTO `v1_5551998b7790215313e45c0e32816cb36787c7258d1b6444c22980c094430e85` VALUES (0, 10, 0, 1, 0, 11, 82, 1, 82017, "小さいお子様はともかく、動物さんに\n好かれる自覚はありますし……\n冒険者という仕事に不向きなことも、\n自認していますけれど……", 1);
